using namespace std;

char strr[100][20];
void strcpy(char *str1,char *str2)
{
    while((*str1++=*str2++)!='\0');
}
void reserve(char str[100][20],int n)
{
    char *s;
    for(int i=0;i<n;i++)
    {
        s=&strr[i][0];
        while(*s!='\0')
        {
            if(*s>='A'&&*s<='Z')
                *s+=32;
            *s++;
        }
    }
}
int strcmp(char *str1,char *str2)
{
    while(*str1!='\0' && *str2!='\0' && *str1==*str2)
    {
        *str1++;*str2++;
    }
    if(*str1>*str2)
        return 1;
    else if(*str1<*str2)
        return -1;
    else
        return 0;
}
void arrange(char str[100][20],char strr[100][20],int n)
{
    for(int i=0;i<n-1;i++)
    {
        int j=i;
        for(int k=i+1;k<n;k++)
        {
            if(strcmp(strr[j],strr[k])==1)
            {
                char s[20];
                strcpy(s,str[j]);
                strcpy(str[j],str[k]);
                strcpy(str[k],s);

                strcpy(s,strr[j]);
                strcpy(strr[j],strr[k]);
                strcpy(strr[k],s);
            }
        }
    }
}
