{
    char str[100][20];
    int n=10;
    for(int i=0;i<n;i++)
         cin>>str[i];
    for(int i=0;i<n;i++)
    {
        for(int j=0;j<20;j++)
        {
            strr[i][j]=str[i][j];
        }
    }
    reserve(str,n);
    arrange(str,strr,n);
    for(int i=0;i<n;i++)
        cout<<str[i]<<" ";
    return 0;
}

