#include<iostream>
using namespace std;

void Reverse_line(char* pBegin,char* pEnd){
    if(pBegin==nullptr || pEnd==nullptr)
        return;

    while(pBegin<pEnd){
        char t=*pBegin;
        *pBegin=*pEnd;
        *pEnd=t;

        pBegin++;
        pEnd--;
    }

}

char* Reverse(char* s){
    if(s==nullptr) return nullptr;

    char* pBegin=s;
    char* pEnd=s;
    while(*pEnd!=0) pEnd++;
    pEnd--;

    Reverse_line(pBegin,pEnd);

    pBegin=pEnd=s;

    while(*pBegin!=0){
        if(*pBegin==' '){
            pBegin++;
            pEnd++;
        }
        else if(*pEnd==' '||*pEnd==0){
            Reverse_line(pBegin,--pEnd);
            pBegin=++pEnd;
        }
        else pEnd++;
    }
    return s;
}

