char words[10][20];

void swap1(char * a, char * b) {
    char temp[20];
    memcpy(temp, a, sizeof(a));
    memcpy(a, b, sizeof(a));
    memcpy(b, temp, sizeof(temp));
}

bool compare(char * a, char * b) {
    int len_a = strlen(a);
    int len_b = strlen(b);
    if(len_a != len_b) {
        return len_a < len_b;
    }
    int n = 0;
    while(n < len_a) {
        if(a[n] != b[n]) return a[n] < b[n];
        n ++;
    }
    return false;
}

