        char * min = words[i], * now = words[i];
        for(int j = i + 1; j < n; j ++) {
            if(compare(words[j], min)) {
                min = words[j];
            }
        }
        swap1(now, min);
    }
    for(int i = 0; i < n; i ++) {
        cout << words[i];
