struct Matrix5x5{
private:
    double m[5][5];
public:
    Matrix5x5()
	{
		for (int row = 0; row < 5; ++ row) {
		    for (int col = 0; col < 5; ++ col) {
                this->m[row][col] = 0;
			}
		}
	}
	double get(int x, int y){
        return m[x][y];
    }

    void set(int x, int y, double k){
        m[x][y] = k;
    }

    Matrix5x5 operator+ (Matrix5x5 & x){
        for (int row = 0; row < 5; ++ row) {
		    for (int col = 0; col < 5; ++ col) {
                this->m[row][col] += x.m[row][col];
			}
		}

        return *this;
	}
};

