class Matrix5x5{
 public:
  double get(int i,int j){
   return ans[i][j];
  }
  void set(int i,int j,double num){
   ans[i][j] = num;
  }
  friend Matrix5x5 operator + (Matrix5x5& one,Matrix5x5& two){
   Matrix5x5 ans;
   for(int i = 0;i < 5;i++){
    for(int j = 0;j < 5;j++){
     ans.set(i,j,one.get(i,j) + two.get(i,j)); 
    }
   }
   return ans;
  }
  Matrix5x5(){
   for(int i = 0;i < 5;i++){
    for(int j = 0;j < 5;j++){
     ans[i][j] = 0;
    }
   }
  }
 private:
  double ans[5][5];
};

