	}

};

Matrix5x5 operator + (Matrix5x5 & m1, Matrix5x5 & m2){
		Matrix5x5 temp;
		for (int i = 0; i < 5; ++ i) {
			for (int j = 0; j < 5; ++ j){
				temp.matrix[i][j] = m1.matrix[i][j] + m2.matrix[i][j];
			} 
		}
		return temp;
}

