            gr.set_v(i, get_v(row - 1, i));
        return gr;
    }
    Matrix getColumn(int columns) {
        Matrix gc = Matrix(rows, 1);
        for (int i = 0; i < rows; ++i)
            gc.set_v(i, get_v(i, columns - 1));
