    //col ä¸€æ · r1 r2ä¸ä¸€æ ·
    int r1 = this->rows;
    int r2 = matrix2.rows;
    int c = this->columns;
    int sz = (r1 + r2) * c;
    double *val = new double[sz + 2];
    int sz1 = r1 * c;
    for (int i = 0; i < sz1; i++)
        val[i] = this->values[i];

    // for (int i = 0; i < sz1; i++)
    //     cout << val[i] << " ";
    int sz2 = r2 * c;
    for (int i = sz1, j = 0; j < sz2; i++, j++)
        val[i] = matrix2.values[j];
    Matrix matrix3(r1 + r2, c, val);
    return matrix3;
}
Matrix Matrix::concatenateColumns(const Matrix &matrix2) const
{
    //rowä¸€æ · c1 c2 ä¸ä¸€æ ·
    int c1 = this->columns;
    int c2 = matrix2.columns;
    int r = this->rows;
    int sz = r * (c1 + c2);
    double *val = new double[sz + 2];
    for (int i = 0; i < r; i++)
    {
        for (int j = 0; j < c1; j++)
            val[i * (c1 + c2) + j] = this->values[i * c1 + j];
        for (int j = 0; j < c2; j++)
            val[i * (c2 + c1) + c1 + j] = matrix2.values[i * c2 + j];
    }
    Matrix matrix3(r, c1 + c2, val);
    return matrix3;
}

