    int col = this->columns;
    double value[row*col];
    for(int i = 0; i < row; ++i){
        for(int j = 0; j < col; ++j){
            if(i < this->rows){//this
                value[i*col+j] = this->values[i*this->columns+j];
            }
            else{//matrix2
                value[i*col+j] = matrix2.values[(i-this->rows)*matrix2.columns+j];
            }
        }
    }
    Matrix res(row,col,value);
    return res;
}

