    for(int i = 0; i < row; ++i){
        for(int j = 0; j < col; ++j){
            if(j < this->columns){//this
                value[i*col+j] = this->values[i*this->columns+j];
            }
            else{//matrix2
                value[i*col+j] = matrix2.values[i*matrix2.columns+j-this->columns];
            }
        }
    }
    Matrix res(row,col,value);
    return res;
}

