Matrix Matrix::concatenateRows(const Matrix &matrix2) const
{
    double val[(rows + matrix2.rows) * columns];
    int index;
    for (int i = 0; i < rows; i++)
    {
        for (int j = 0; j < columns; j++)
        {
            val[i * columns + j] = values[i][j];
            index = i * columns + j;
        }
    }
    for (int i = 0; i < matrix2.rows; i++)
    {
        for (int j = 0; j < matrix2.columns; j++)
        {
            val[index + 1 + i * matrix2.columns + j] = matrix2.values[i][j];
        }
    }
    return Matrix(rows + matrix2.rows, columns, val);
}

Matrix Matrix::concatenateColumns(const Matrix &matrix2) const
{
    double val[rows*(columns+matrix2.columns)];
    double matrix[rows][columns+matrix2.columns];
    for(int i = 0;i < rows;i++)
    {
        for (int j = 0; j < columns; j++)
            matrix[i][j] = values[i][j];
    }
    for(int i = 0;i < rows;i++)
    {
        for (int j = 0; j < matrix2.columns; j++)
        {
            matrix[i][columns + j] = matrix2.values[i][j];
        }
    }
    for(int i = 0;i < rows;i++)
    {
        for (int j = 0; j < columns + matrix2.columns; j++)
        {
            val[i * (columns + matrix2.columns) + j] = matrix[i][j];
        }
    }
    return Matrix(rows,columns+matrix2.columns,val);
