    {
        Matrix print;
        print.columns = this->columns + mtr.columns;
        print.rows = this->rows;
        double *elem = new double [(this->columns + mtr.columns) * this->rows];
        for (int i = 0, i1 = 0, i2 = 0; i < ((this->columns + mtr.columns) * this->rows); ) {
            for (int j = 0; j < this->columns; ++j) {
                elem[i] = this->values[i1];
                ++i;
