#include <iostream>
#include <iomanip>
using namespace std;

struct Matrix{
private:
    int rows;
    int columns;
    double **values;
public:
    Matrix(int r, int c, double values[]) :rows(r), columns(c)
    {
        this->values = new double*[rows]();
        for(int i = 0; i != rows; ++i){
            this->values[i] = new double[columns]();
        }

        int k = 0;
        for(int i = 0; i != rows; ++i){
            for(int j = 0; j != columns; ++j){
                this->values[i][j] = values[k++];
            }
        }
    }

    Matrix(const Matrix & matrix2){
        this->rows = matrix2.rows;
        this->columns = matrix2.columns;
        this->values = new double*[rows]();
        for(int i = 0; i != rows; ++i){
            this->values[i] = new double[columns]();
        }
        for(int i = 0; i != rows; ++i){
            for(int j = 0; j != columns; ++j){
                this->values[i][j] = matrix2.values[i][j];
            }
        }
    }

    ~Matrix()
    {
        for(int i = 0; i != rows; ++i){
            delete [] values[i];
        }
        delete values;
    }

    void print();
    Matrix getRow(int row);
    Matrix getColumn(int column);
    Matrix concatenateRows(const Matrix & matrix2) const;
    Matrix concatenateColumns(const Matrix & matrix2) const;
};

void Matrix::print(){
    for(int i = 0; i != rows; ++i){
        for(int j = 0; j != columns; ++j){
            cout << "    " << values[i][j];
        }
        cout << endl;
    }
}

Matrix Matrix::getRow(int row){
    Matrix tmp(1, this->columns, this->values[row - 1]);
    return tmp;
}

Matrix Matrix::getColumn(int column){    
    double d[20];
    for(int i = 0; i != rows; ++i){
        d[i] = values[i][column - 1];
    }

    Matrix tmp(this->rows, 1, d);
    return tmp;
}

Matrix Matrix::concatenateRows(const Matrix & matrix2) const{
    double st[100];    
    int k = 0;
    for(int i = 0; i != this->rows + matrix2.rows; ++i){
        for(int j = 0; j != this->columns; ++j){
            if(i < this->rows) st[k++] = this->values[i][j];
            else st[k++] = matrix2.values[i - this->rows][j];
        }
    }
    Matrix tmp(this->rows + matrix2.rows, this->columns, st);
    return tmp;
}

Matrix Matrix::concatenateColumns(const Matrix & matrix2) const{
    double st[100];    
    int k = 0;
    for(int i = 0; i != this->rows; ++i){
        for(int j = 0; j != this->columns + matrix2.columns; ++j){
            if(j < this->columns) st[k++] = this->values[i][j];
            else st[k++] = matrix2.values[i][j - this->columns];
        }
    }
    Matrix tmp(this->rows, this->columns + matrix2.columns, st);
    return tmp;
}

