	public:
	Matrix(){
		rows=0;
		columns=0;
	}
	Matrix(int row,int column,double *value){
		int i;
		rows=row;
		columns=column;
		this->values=new double[row*column];
		for(i=0;i<row*column;i++){
			this->values[i]=value[i];
		}
	}
	Matrix(const Matrix &s2){
		this->rows=s2.rows;
		this->columns=s2.columns;
		this->values=new double[this->rows*this->columns];
		int i;
		for(i=0;i<this->rows*this->columns;i++){
			this->values[i]=s2.values[i];
		}

	}
	~Matrix(){
		delete values;
	}
	void print(){
		int i;
		int cnt=0;
		for(i=0;i<rows*columns;i++){
			printf("    %0.0f",values[i]);
			cnt++;
			if(cnt%columns==0) {
				printf("\n");
			}
		}
	}
	Matrix concatenateRows(const Matrix & matrix2){
	Matrix ret;
		ret.values=new double[this->rows*this->columns+matrix2.rows*matrix2.columns];  
			ret.rows=this->rows+matrix2.rows;
		ret.columns=this->columns;
		int i;
		for(i=0;i<this->rows*this->columns;i++){
			ret.values[i]=this->values[i];
		}
		for(i=this->rows*this->columns;i<this->rows*this->columns+matrix2.rows*matrix2.columns;i++){
			ret.values[i]=matrix2.values[i-this->rows*this->columns];
		}
		return ret;
	}
	Matrix concatenateColumns(const Matrix & matrix2){
		Matrix ret;
		ret.values=new double[this->rows*this->columns+matrix2.rows*matrix2.columns];
		ret.rows=this->rows;
		ret.columns=this->columns+matrix2.columns;
		int i;
		int j;
		for(i=0;i<this->rows;i++){
			for(j=i*ret.columns;j<(i+1)*ret.columns;j++){
				if(j-i*ret.columns<this->columns){
					ret.values[j]=this->values[j-matrix2.columns*i];
				}
				else ret.values[j]=matrix2.values[j-this->columns*(i+1)];
			}
		}
		return ret;
	}
};

#include <cstring>
#include <iostream>
using namespace std;

class Matrix
{
private:
	int rows;
	int columns;
	double * data;

	void __copy(int rows, int columns, const double * data=NULL) {
		this->rows = rows;
		this->columns = columns;
		int num_data = rows * columns;
		this->data = new double[num_data];
		if (data == NULL)
			memset(this->data, 0, num_data * sizeof(double));
		else
			memcpy(this->data, data, num_data * sizeof(double));
	}

	double & __get(int row, int col) const {
		int index = row * this->columns + col;
		return this->data[index];
	}

public:
	Matrix(int rows, int columns, const double * data=NULL) {
		this->__copy(rows, columns, data);
	}

	~Matrix() {
		delete [] this->data;
	}

	Matrix(const Matrix & m) {
		this->__copy(m.rows, m.columns, m.data);
	}

	Matrix & operator = (const Matrix & m) {
		delete [] this->data;
		this->__copy(m.rows, m.columns, m.data);
	}

	void print(ostream & out=cout, const char * spaces = "    ") const {
		for (int i = 0; i < this->rows; ++ i) {
			for (int j = 0; j < this->columns; ++ j) {
				out << spaces << this->__get(i, j);
			}
			out << endl;
		}
	}

	Matrix concatenateRows(const Matrix & matrix2) const {
		Matrix res(this->rows + matrix2.rows, this->columns);
		/*
		for (int i = 0; i < this->rows; ++ i) 
			for (int j = 0; j < this->columns; ++ j)
				res.__get(i, j) = this->__get(i, j);
		for (int i = 0; i < matrix2.rows; ++ i) 
			for (int j = 0; j < matrix2.columns; ++ j)
				res.__get(this->rows + i, j) = matrix2.__get(i, j);
		*/
		memcpy(res.data, this->data, this->rows * this->columns * sizeof(double));
		memcpy(res.data + this->rows * this->columns, matrix2.data, matrix2.rows * matrix2.columns * sizeof(double));		
		return res;
	}

	Matrix concatenateColumns(const Matrix & matrix2) const {
		Matrix res(this->rows, this->columns + matrix2.columns);
		for (int i = 0; i < this->rows; ++ i) 
			for (int j = 0; j < this->columns; ++ j)
				res.__get(i, j) = this->__get(i, j);
		for (int i = 0; i < matrix2.rows; ++ i) 
			for (int j = 0; j < matrix2.columns; ++ j)
				res.__get(i, this->columns + j) = matrix2.__get(i, j);
		return res;
	}

};

