double & Tensor_get(int dimensions, const int sizes[], double data[], int x0, int x1, int x2, int x3){
	int res;
	if(dimensions == 1) res = x0;
	else if(dimensions == 2) res = x0 * sizes[1] + x1;
	else if(dimensions == 3) res = x0 * sizes[1]*sizes[2] + x1 * sizes[2] + x2;
	else if(dimensions == 4) res = x0 * sizes[1]*sizes[2]*sizes[3] + x1 * sizes[2]*sizes[3] + x2 * sizes[3] + x3;
	return data[res];
}

