	else if(dimensions == 3) pos = x2 + x1 * sizes[1] + x0 * sizes[1] * sizes[2];
	else if(dimensions == 4) pos = x3 + x2 * sizes[1] + x1 * sizes[1] * sizes[2] + x0 * sizes[1] * sizes[2] * sizes[3];
	return data[pos];
}

