	for(int i = 0 ; i < di ; i ++) {
		for(int k = i + 1 ; k < di ; k ++) {
			all[i] *= size[k] ;
		}
	}
	int count = 0 ;
	int wei[] = {x0,x1,x2,x3} ;
	for(int i = 0 ; i < di ; i ++) {
		count += wei[i]*all[i] ;
	}
	return data[count] ;
}

